// Header.js
import React from 'react';

function Header() {
  return (
    <header className="bg-gray-800 text-white py-4">
      <div className="container mx-auto">
        <h1 className="text-2xl font-">Have Fun Tattoo</h1>
      </div>
    </header>
  );
}

export default Header;
